import React from 'react';

function Education() {
  return (
    <section id="education" style={{ marginLeft: "10px", display: "flex", alignItems: "center", flexDirection: "column" }}>
      <h2>Education</h2>
      <ul>
        <li>Bachelor's Degree in B.Sc. (Computer Science), XYZ University, 2015-2019</li>
        <li>Master's Degree in Computer MCA, ABC University, 2019-2021</li>
      </ul>
    </section>
  );
}

export default Education;
